import API from "../../utils/API.js"
import {List, ListItem, ListItemText} from '@material-ui/core'

async function ScoreList()
{
    var scoreItems;

    const lst = await API.getScores("user");
    for (let i = 0 ; i < lst.lenght; i++)
    {
        scoreItems.push(
            <ListItem>
                <ListItemText primary= "coucou"/>
            </ListItem>
        );
    }
    return(
    	<List>
            {scoreItems}
        </List>);
}

export default ScoreList;
